import React, { Component } from 'react'
import Layout from '../components/mapLayout'


export class map extends Component {
    render() {
        return (
         <Layout>
             <div className = "container-fluid conMap h-100">
                 <div className = "row h-100">
                     <div className = "col-lg-6">
                         
                     </div>
                 </div>
             </div>
         </Layout>
        )
    }
}

export default map
